import React,{useState} from 'react'
import {Box,Grid,Paper } from '@mui/material';
const Inicio = () => {
  //Agregar Formulario
  const section = {
    height: "100%",
    backgroundColor: "#fff"
  };
  return ( 
    
            <Box sx={{ flexGrow: 1 }}>
              <Grid container spacing={1}  minHeight="80vh">
                <Grid item xs={12} md={6}>
                <div style={section}>component</div>
                </Grid>
                <Grid item xs={12} md={6}>
                <div style={section}>component</div>
                </Grid>
                <Grid item xs={12} md={6}>
                   <div style={section}>component</div>
                </Grid>
        
              </Grid>
            </Box>
      
  )
}

export default Inicio
